import React from 'react'
import SearchBar from './searchBar/SearchBar'

const searchedList = ["tooth paste","tooth brush","mouth wash","dental floss","mouth guard"]

const App = () => {
    return (
        <div>
            <SearchBar 
            searchedList={searchedList}
            />
        </div>
    )
}

export default App
